import { View, Text } from "react-native";
import React from "react";

export default function ProductItem(props) {
  return (
    <View>
      <Image
        style={styles.stretch}
        source={require(props.item.image_url)}
      />
      <Text>{props.item.title}</Text>
    </View>
  );
}
